import React from 'react';

const CTA = () => {
  return (
    <section id="cta" className="bg-blue-500 text-white py-8 text-center">
      <h2 className="text-2xl font-bold mb-4">Sign Up Now</h2>
      <button className="bg-white text-blue-500 px-4 py-2 rounded">
        Sign Up
      </button>
    </section>
  );
};

export default CTA;
